import React from 'react';
//import LogoInicio from '../public/LogoInicio.jpg';
import { NavLink } from 'react-router-dom';
//<img src={LogoInicio} alt="LogoDL" />
const Inicio = () => {
    return (
        <div className="divBasico">
            <table className="divBasico">
                <nav className="linkContainer">
                    <div >                    
                        <NavLink ClassName="linkMenu" exact to="/Timeline" className="nav-link" id="dash" >TimeLine</NavLink>
                    </div>
                </nav>
            </table>
        </div>
    )
}

export default Inicio
